package com.ufgov.zc.server.system.service.impl;import java.util.List;import com.ufgov.zc.common.commonbiz.model.BaseBill;import com.ufgov.zc.common.system.model.GkBusinessLog;import com.ufgov.zc.server.system.dao.IGkBusinessLogDao;import com.ufgov.zc.server.system.service.IGkBusinessLogService;public class GkBusinessLogService implements IGkBusinessLogService {  private IGkBusinessLogDao gkBusinessLogDao;  public IGkBusinessLogDao getGkBusinessLogDao() {    return gkBusinessLogDao;  }  public void setGkBusinessLogDao(IGkBusinessLogDao gkBusinessLogDao) {    this.gkBusinessLogDao = gkBusinessLogDao;  }  public List getGkBusinessLog(BaseBill bill) {    return gkBusinessLogDao.getGkBusinessLog(bill);  }  public List getGkBusinessLog(String billid, String tabname) {    return gkBusinessLogDao.getGkBusinessLog(billid, tabname);  }  public void saveGkBusinessLog(GkBusinessLog log) {    gkBusinessLogDao.saveGkBusinessLog(log);  }  public void saveGkBusinessLog(List logList) {    gkBusinessLogDao.saveGkBusinessLog(logList);  }}